import { AppContext } from "../../App";
import { useContext } from "react";


export const Temp = (props) => {

  const {image} = useContext(AppContext)

  return (
    <div className="main">
      <div className="temperature" style={{image}}>
        <div></div>
      </div>
      <div>{Math.floor(props.cityTemp) + "C" || ""}</div>
      <div className="otherDays"></div>
    </div>
  );
};
